h:100%;min-height:1px;fill:#e6dcc6;stroke:#e6dcc6;height:100%;"><g id="zyulSc2qNvjDwKY3" style="transform:scale(1) translate(0px, 0.5px);"><line x1="0" x2="1366" y1="0" y2="0" style="fill:none;stroke-linecap:butt;"></line></g></svg></div></div></div><div id="Pz57OObckGVBi7ze" style="z-index:3;position:relative;"><div id="OJaBAfGojH45BNjF" style="transform:rotate(0deg);width:100%;box-sizing:border-box;height:100%;"><div id="SqBSbgb8WY3x8MWD" style="flex-direction:column;display:flex;width:100%;justify-content:flex-start;opacity:1.0;height:100%;"><p id="sYf3xZGiJ1XrFhzN" style="text-transform:none;color:#e6dcc6;letter-spacing:0em;font-family:YAD1aU3sLnI-0;line-height:1.4em;"><span id="p0Na9vQGaZk4oOmq" style="color:#e6dcc6;">Notre agence matrimonial est d√©di√© √† aider les musulmans </span><span id="UYwg792yIQeSO73K" style="text-decoration-line:underline;color:#e6dcc6;font-weight:700;">pratiquants</span><span id="Th1zjeldJhzSFtXJ" style="color:#e6dcc6;"> √† trouver leur partenaire id√©al en suivant les principes de la foi islamique et </span><span id="veU9N97BFU51LtfQ" style="text-decoration-line:underline;color:#e6dcc6;font-weight:700;">tout cela GRATUITEMENT</span><span id="IlxGS2sa0rbA6bUB" style="color:#e6dcc6;">. Nous croyons que la mise en relation de personnes compatibles dans le respect des enseignements de l&#x27;Islam peut contribuer √† la cr√©ation de </span><span id="Yh5CHV1uCLTn6s4J" style="text-decoration-line:underline;color:#e6dcc6;font-weight:700;">foyers heureux et solides.</span><br></p></div></div></div><div id="CwxnovaLbjRtngq1" style="z-index:9;position:relative;"><div id="sa6L9QseoCfvY0Lm" style="transform:rotate(0deg);width:100%;box-sizing:border-box;height:100%;"><div id="Zava2SOnUGTNIPXe" style="flex-direction:column;display:flex;width:100%;justify-content:flex-start;opacity:1.0;height:100%;"><p id="so1f9mVTyiJcy3LS" style="color:#e6dcc6;letter-spacing:0em;font-family:YAEszk0JTZ8-0;line-height:1.3em;text-align:center;"><span id="L2A5tztPuAJXcSV8" style="color:#e6dcc6;">...</span><br></p></div></div></div><div id="ycCbeHomvMaLGZDc" style="z-index:5;position:relative;"><div id="RUP50szDyfzdH47X" style="transform:rotate(0deg);width:100%;box-sizing:border-box;height:100%;"><div id="IG0mDwFn0EstRv4l" style="flex-direction:column;display:flex;width:100%;justify-content:flex-start;opacity:1.0;height:100%;"><p id="tqN6zAz594ZmleVZ" style="color:#e6dcc6;font-family:YAD1aU3sLnI-0;line-height:1.4em;"><span id="VVrv2HjSZN9Q6cdJ" style="color:#e6dcc6;">Voici comment fonctionne notre service : Nous pr√©sentons √† la femme par mail les profils masculins qui r√©pondent √† ses crit√®res de s√©lection. Si l&#x27;un d&#x27;entre eux retient son attention, nous transmettons alors les coordonn√©es de son tuteur masculin (</span><span id="PjGWVwFxahe0Bdei" style="text-decoration-line:underline;color:#e6dcc6;font-weight:700;">wali</span><span id="hc6AR92frDg2BiQq" style="color:#e6dcc6;">) √† l&#x27;homme correspondant afin que les deux pr√©tendants puissent mieux apprendre √† se conna√Ætre via une muquabalah et donc d&#x27;une mani√®re </span><span id="XpIKMTxKrsMuqJLh" style="text-decoration-line:underline;color:#e6dcc6;font-weight:700;">100% halal</span><span id="oQ15MtLQEygk3pOV" style="color:#e6dcc6;"> (ie : pas de conversation sans tuteur).</span></p><p id="XZYqMO0t4wofmspF" style="color:#e6dcc6;white-space:pre;font-family:YAD1aU3sLnI-0;line-height:1.4em;"><br></p><p id="aEnqztJngMsIL7Pm" style="text-transform:none;color:#e6dcc6;white-space:pre;letter-spacing:0em;font-family:YAD1aU3sLnI-0;line-height:1.4em;text-align:left;"><br></p></div></div></div><div id="LmGscbAo91gz3cta" style="z-index:7;position:relative;"><div id="hkCkVXYOmO8zPXOd" style="transform:rotate(0deg);width:100%;box-sizing:border-box;height:100%;"><div id="C7LHd1fxQUuixoXx" style="flex-direction:column;display:flex;width:100%;justify-content:flex-start;opacity:1.0;height:100%;"><p id="nzXWLbL6DPyhCbDG" style="text-transform:none;color:#e6dcc6;letter-spacing:0em;font-family:YAD1aU3sLnI-0;line-height:1.4em;text-align:left;"><span id="iAvjfCjUBId599M2" style="color:#e6dcc6;">Notre site est </span><span id="vSmN15kZkTQ4BSHm" style="text-decoration-line:underline;color:#e6dcc6;font-weight:700;">tr√®s s√©lectif,</span><span id="sr1otWV3RitUwcOT" style="color:#e6dcc6;"> car nous sommes d√©termin√©s √† cr√©er des correspondances compatibles dans le respect des principes fondamentaux de notre foi et de la </span><span id="JduHpjDbXRvmFMqi" style="text-decoration-line:underline;color:#e6dcc6;font-weight:700;">sunnah</span><span id="b9UPMJPqXTroksMj" style="color:#e6dcc6;">. Nous nous permettrons donc de ne pas fournir notre service pour les hommes qui ne prient pas ou les femmes sans hijab par exemple.</span><br></p></div></div></div></div></section><section id="GmuB0NYvKEFig07I" style="z-index:0;overflow:hidden;grid-template-columns:auto 100rem auto;display:grid;margin-top:-1px;position:relative;align-items:center;"><div id="WKnd33g61XZBKah5" style="display:grid;min-height:100%;position:absolute;grid-area:1 / 1 / 2 / 4;min-width:100%;"><div id="mrndLNgsVrFG25cE" style="z-index:0;position:relative;"><div id="kAGgVmc5uECugQB8" style="transform:rotate(0deg);width:100%;box-sizing:border-box;height:100%;"><div id="pmUwtVXvS6fvtORv" style="width:100%;opacity:1.0;height:100%;"><div id="omYd4tCE3OlnhZq5" style="background-color:#2a292b;transform:scale(1, 1);overflow:hidden;width:100%;position:relative;opacity:1.0;height:100%;"></div></div></div></div></div><div id="ycnuJg0uBgAgDtBC" style="display:grid;position:relative;grid-area:1 / 2 / 2 / 3;"><div id="SupF0KEu3Fn8KSJ3" style="z-index:4;position:relative;"><div id="VbzedDHeEbXiLoeh" style="padding-top:0.08862646%;transform:rotate(0deg);"><div id="MEzVue7JOCHUNezt" style="top:0px;left:0px;width:100%;position:absolute;height:100%;"><svg id="tGvsnJIvlAPAS7Qq" viewBox="0 0 1365.9101921498861 1.2105578905530565" preserveAspectRatio="none" style="overflow:visible;display:block;width:1